// Validate incoming webhook data
const body = $input.item.json.body || {};
const buildPath = body.build_path;
const projectName = body.project_name;
const clientName = body.client_name;

if (!buildPath) {
  return {
    status: 400,
    error: 'Missing required field: build_path',
    message: 'POST body must include { "build_path": "/path/to/project", "project_name": "", "client_name": "" }'
  };
}

// Normalize path (handle Windows/Linux)
const normalizedPath = buildPath.replace(/\\/g, '/');

return {
  build_path: buildPath,
  normalized_path: normalizedPath,
  project_name: projectName || 'Unknown Project',
  client_name: clientName || 'Unknown Client',
  errors: [],
  warnings: []
};

// Call Build Artifact Reader workflow
const data = $input.item.json;

try {
  // Prepare input for Build Artifact Reader
  return {
    ...data,
    step: 'build_artifact_reader',
    step_input: {
      build_path: data.build_path
    }
  };
} catch (error) {
  return {
    ...data,
    errors: [...(data.errors || []), {
      step: 'build_artifact_reader',
      error: error.message
    }]
  };
}

// Process Build Artifact Reader results
const previousData = $('Prepare Artifact Reader').item.json;
const result = $input.item.json;

// Check if workflow succeeded
if (!result || result.status === 400) {
  return {
    ...previousData,
    artifacts: null,
    errors: [...(previousData.errors || []), {
      step: 'build_artifact_reader',
      error: result?.error || 'Failed to read build artifacts'
    }],
    warnings: [...(previousData.warnings || []), 'Continuing without artifacts']
  };
}

return {
  ...previousData,
  artifacts: result,
  prd_content: result.prd_content,
  state_content: result.state_content,
  workflows_content: result.workflows || []
};

// Prepare PRD Analyzer input
const data = $input.item.json;

if (!data.prd_content) {
  return {
    ...data,
    prd_analysis: null,
    warnings: [...(data.warnings || []), 'Skipping PRD analysis - no PRD content']
  };
}

return {
  ...data,
  step: 'prd_analyzer',
  step_input: {
    prd_content: data.prd_content
  }
};

// Process PRD Analyzer results
const previousData = $('Prepare PRD Analyzer').item.json;
const result = $input.item.json;

if (!result || result.status === 400) {
  return {
    ...previousData,
    prd_analysis: null,
    errors: [...(previousData.errors || []), {
      step: 'prd_analyzer',
      error: result?.error || 'Failed to analyze PRD'
    }]
  };
}

return {
  ...previousData,
  prd_analysis: result
};

// Prepare State Analyzer input
const data = $input.item.json;

if (!data.state_content) {
  return {
    ...data,
    state_analysis: null,
    warnings: [...(data.warnings || []), 'Skipping state analysis - no state file']
  };
}

return {
  ...data,
  step: 'state_analyzer',
  step_input: {
    state_content: data.state_content
  }
};

// Process State Analyzer results
const previousData = $('Prepare State Analyzer').item.json;
const result = $input.item.json;

if (!result || result.status === 400) {
  return {
    ...previousData,
    state_analysis: null,
    errors: [...(previousData.errors || []), {
      step: 'state_analyzer',
      error: result?.error || 'Failed to analyze state'
    }]
  };
}

return {
  ...previousData,
  state_analysis: result
};

// Prepare Workflow Analyzer input
const data = $input.item.json;

if (!data.workflows_content || data.workflows_content.length === 0) {
  return {
    ...data,
    workflow_analysis: null,
    warnings: [...(data.warnings || []), 'Skipping workflow analysis - no workflows']
  };
}

return {
  ...data,
  step: 'workflow_analyzer',
  step_input: {
    workflows: data.workflows_content
  }
};

// Process Workflow Analyzer results
const previousData = $('Prepare Workflow Analyzer').item.json;
const result = $input.item.json;

if (!result || result.status === 400) {
  return {
    ...previousData,
    workflow_analysis: null,
    errors: [...(previousData.errors || []), {
      step: 'workflow_analyzer',
      error: result?.error || 'Failed to analyze workflows'
    }]
  };
}

return {
  ...previousData,
  workflow_analysis: result
};

// Prepare Token Estimator input
const data = $input.item.json;

if (!data.workflow_analysis || !data.workflow_analysis.data) {
  return {
    ...data,
    token_analysis: null,
    warnings: [...(data.warnings || []), 'Skipping token estimation - no workflow data']
  };
}

return {
  ...data,
  step: 'token_estimator',
  step_input: {
    workflows: data.workflow_analysis.data
  }
};

// Process Token Estimator results
const previousData = $('Prepare Token Estimator').item.json;
const result = $input.item.json;

if (!result || result.status === 400) {
  return {
    ...previousData,
    token_analysis: null,
    errors: [...(previousData.errors || []), {
      step: 'token_estimator',
      error: result?.error || 'Failed to estimate tokens'
    }]
  };
}

return {
  ...previousData,
  token_analysis: result
};

// Prepare AI Summary Generator input
const data = $input.item.json;

// Gather all available metrics for summary
const metrics = {
  project_name: data.project_name,
  client_name: data.client_name,
  prd_analysis: data.prd_analysis?.data || null,
  state_analysis: data.state_analysis?.data || null,
  workflow_analysis: data.workflow_analysis?.data || null,
  token_analysis: data.token_analysis?.data || null
};

return {
  ...data,
  step: 'ai_summary_generator',
  step_input: metrics
};

// Process AI Summary results
const previousData = $('Prepare AI Summary').item.json;
const result = $input.item.json;

if (!result || result.status === 400) {
  return {
    ...previousData,
    ai_summary: null,
    errors: [...(previousData.errors || []), {
      step: 'ai_summary_generator',
      error: result?.error || 'Failed to generate AI summary'
    }]
  };
}

return {
  ...previousData,
  ai_summary: result
};

// Prepare Architecture Diagram Generator input
const data = $input.item.json;

if (!data.workflow_analysis || !data.workflow_analysis.data) {
  return {
    ...data,
    architecture_diagram: null,
    warnings: [...(data.warnings || []), 'Skipping architecture diagram - no workflow data']
  };
}

return {
  ...data,
  step: 'architecture_diagram_generator',
  step_input: {
    workflows: data.workflow_analysis.data
  }
};

// Process Architecture Diagram results
const previousData = $('Prepare Architecture Diagram').item.json;
const result = $input.item.json;

if (!result || result.status === 400) {
  return {
    ...previousData,
    architecture_diagram: null,
    errors: [...(previousData.errors || []), {
      step: 'architecture_diagram_generator',
      error: result?.error || 'Failed to generate architecture diagram'
    }]
  };
}

return {
  ...previousData,
  architecture_diagram: result
};

// Prepare Dashboard Spec Generator input
const data = $input.item.json;

const dashboardInput = {
  project_name: data.project_name,
  client_name: data.client_name,
  prd_analysis: data.prd_analysis,
  state_analysis: data.state_analysis,
  workflow_analysis: data.workflow_analysis,
  token_analysis: data.token_analysis,
  ai_summary: data.ai_summary,
  architecture_diagram: data.architecture_diagram
};

return {
  ...data,
  step: 'dashboard_spec_generator',
  step_input: dashboardInput
};

// Process Dashboard Spec results
const previousData = $('Prepare Dashboard Spec').item.json;
const result = $input.item.json;

if (!result || result.status === 400) {
  return {
    ...previousData,
    dashboard_spec: null,
    errors: [...(previousData.errors || []), {
      step: 'dashboard_spec_generator',
      error: result?.error || 'Failed to generate dashboard spec'
    }]
  };
}

return {
  ...previousData,
  dashboard_spec: result
};

// Prepare Supabase Storage input
const data = $input.item.json;

const storageInput = {
  project_name: data.project_name,
  client_name: data.client_name,
  prd_data: data.prd_analysis,
  state_data: data.state_analysis,
  workflows_data: data.workflow_analysis,
  token_data: data.token_analysis,
  summary_data: data.ai_summary,
  diagram_data: data.architecture_diagram,
  dashboard_spec: data.dashboard_spec
};

return {
  ...data,
  step: 'supabase_storage',
  step_input: storageInput
};

// Process Supabase Storage results
const previousData = $('Prepare Supabase Storage').item.json;
const result = $input.item.json;

if (!result || result.status === 400) {
  return {
    ...previousData,
    storage_result: null,
    errors: [...(previousData.errors || []), {
      step: 'supabase_storage',
      error: result?.error || 'Failed to store in Supabase'
    }]
  };
}

return {
  ...previousData,
  storage_result: result
};

// Build final response
const data = $input.item.json;

// Count successes and failures
const steps = [
  'build_artifact_reader',
  'prd_analyzer',
  'state_analyzer',
  'workflow_analyzer',
  'token_estimator',
  'ai_summary_generator',
  'architecture_diagram_generator',
  'dashboard_spec_generator',
  'supabase_storage'
];

const successCount = steps.filter(step => {
  const resultKey = step.replace('_generator', '').replace('build_artifact_reader', 'artifacts');
  return data[resultKey] !== null && data[resultKey] !== undefined;
}).length;

const failureCount = data.errors.length;
const warningCount = data.warnings.length;

// Determine overall status
const hasErrors = failureCount > 0;
const status = hasErrors ? 'partial_success' : 'success';
const statusCode = hasErrors ? 207 : 200; // 207 = Multi-Status

return {
  status: statusCode,
  result: status,
  project_name: data.project_name,
  client_name: data.client_name,
  summary: {
    steps_total: steps.length,
    steps_succeeded: successCount,
    steps_failed: failureCount,
    warnings: warningCount
  },
  dashboard_spec: data.dashboard_spec?.data || null,
  storage: data.storage_result?.data || null,
  errors: data.errors,
  warnings: data.warnings,
  message: hasErrors 
    ? `Analysis completed with ${failureCount} failures and ${warningCount} warnings`
    : 'Analysis completed successfully'
};
